■商品説明■<br>

EMU「エミュー」のセカンドラインとして2011年秋に登場した人気ブランド！UKALA「ウカラ」のシープスキンブーツ「ムートンブーツ」が入荷いたしました。こちらの「SYDNEY LOW シドニー ロー」タイプは一番定番の「足のくるぶしとヒザの間ぐらいの長さで上部分を少し折り返す事も可能な丈の長さのタイプです。快適さを常に追及するUKALAのムートンブーツは、内側の熱を外に流すように作られている為、適度な温度に保つことができます。ソール部分には丈夫なEVAを使用することによって、滑りにくく歩きやすいように工夫されており、本家のEMU「エミュー」にも引けを取らない上質な素材、パーツを使用している事で今、大変売れているブランドです。しかも期間限定にてスペシャルプライスにてご提供中です。◆注意事項◆この商品は、海外からの輸入商品の為、箱のキズやへこみなどがある場合がございます。商品自体には問題ありませんのでご安心ください。<table width="100%" cellspacing="2" cellpadding="0" border="0">
